import React from "react";
// // import { Button } from "@/components/ui/button";
import Button from "../components/ui/button";
import { FaUserCircle } from "react-icons/fa";

// // import { Card, CardContent } from "../components/ui/card";


const Header = () => {
  return (
    <div className="flex justify-between items-center p-4 bg-gray-800 text-white rounded-lg">
      <h1 className="text-xl font-bold text-yellow-400">BINANCE</h1>
      <FaUserCircle size={40} className="text-yellow-400" />
      <Button className="bg-yellow-400 text-black font-semibold">Deposit</Button>
    </div>
  );
};

export default Header;



